import React, { Fragment } from "react";
import Navbar from "./components/Navbar.jsx";
import Home from "./components/Home.jsx";
import "./App.css";
import { Route, Router, Routes } from "react-router-dom";

function App() {
  return (
    <Fragment>
      <Router>
        <Routes>
          <Route path="/" element={Home}></Route>
        </Routes>
      </Router>
      <Navbar />
      <Home />
    </Fragment>
  );
}

export default App;
